import React from 'react';
import './App.css';
import {} from './styles';

const ListWrapper = (props) => {
	return (
		<ul data-testid="list-of-players">
			{props.searchResult.length > 0
				? props.searchResult.map((player) => (
						<li key={player.id}>
							<p>{player.name}</p>
							<button
								className="hashtag"
								onClick={() => props.filterByCountry(player.country)}
							>
								#{player.country.toLowerCase()}
							</button>
						</li>
				  ))
				: players.map((player) => (
						<li key={player.id}>
							<p>{player.name}</p>
							<button
								className="hashtag"
								onClick={() => filterByCountry(player.country)}
							>
								#{player.country.toLowerCase()}
							</button>
						</li>
				  ))}
		</ul>
	);
};

export default ListWrapper;
